  false,\n\t\"url\": null,\n\t\"notes\": \"This is the fiscal year 2000 annual narrative
  report for Neal Smith National Wildlife Refuge.  The report begins with information
  about monitoring and studies which includes a breeding bird survey and a study on
  nitrate loading.  Habitat restoration and habitat management projects are also covered;
  activities include planting, harvesting, mowing, grazing, haying, pest plant control,
  and fire management.  Fish and wildlife management are discussed next.  Coordination
  activities are outlined, as well as resource protection.  Resource protection activities
  include law enforcement and land acquisition.  Information about public education
  and recreation is given including education, school programs, and seminars.  Finally,
  refuge planning and administration are discussed.  Lists of refuge personnel and
  volunteer programs are provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
